import React from 'react';

const Header = () => {
    return (
        <div className="d-flex justify-content-between">
        <nav className="navbar bg-light mb-3">
            <div className="container-fluid">
                        <a className="navbar-brand" href="#">Прогноз погоды</a>
            </div>
        </nav>
        </div>
    );
};

export default Header;
